import React from 'react';

function ExecutionControl({ onRun, onStop }) {
  return (
    <div className="card">
      <h2>Execution Control</h2>
      <button className="btn-primary" onClick={onRun}>Run Tests</button>
      <button className="btn-secondary" onClick={onStop}>Stop Tests</button>
    </div>
  );
}

export default ExecutionControl;
